import React from "react";
import "./News.css";
function News() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>News</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Get the latest technology news and in-depth analysis from the expert
        analysts at Lappora.
      </h5>
      <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
      <br />
    </div>
  );
}

export default News;
